import "bootstrap/dist/css/bootstrap.min.css";
import logoGeo from "../assets/img/logo/geo-logo.svg";
import './HeaderFDI.css'
function HeaderFDI() {
  return (
    <div>
      <div
        class="  d-flex flex-row justify-content-around pt-2 bg"
        style={{ backgroundColor: "#F5F6FF", height: " 100px" }}
      >
        <div class="col-2 d-flex justify-content-center align-items-center" >
          <img src={logoGeo} class="img-thumbnail" alt="..."  style={{ backgroundColor: "#F5F6FF", border: "none" }}/>
        </div>
        <div class="col-5 d-flex justify-content-center align-items-center">
        <h1 class="responsive-font-example">პირდაპირი უცხოური ინვესტიციების პორტალი</h1>
          </div>
        <div class="col-2 d-flex justify-content-center align-items-center">3 of 3</div>
      </div>
    </div>
  );
}
export default HeaderFDI;
